entry.summary:
The fire is moving towards the Peace River and is threatening structures in the area. 
Area: (There is an out of control wildfire burning in Saddle Hills County, in the Fourth Creek area, between Township road 840 and the Peace River, between Range Rd 75 and Range Rd 85. 
)

Alberta Wildfire is responding to RWF031 within Clearwater County. The wildfire is approximately 90 ha and 18 km southeast of Nordegg and 20km southeast of the Bighorn First Nation. 
Area: (This evacuation alert is in effect for everyone west of Beaverdam Provincial Recreation Area and east of the Bighorn Dam, this includes the hamlet of Nordegg.


